  (XBT) casts from NOAA Ship FAIRWEATHER in the North Pacific Ocean in support of
  the Integrated Global Ocean Services System (IGOSS) project from 1974-09-12 to 1974-09-15
  (NCEI Accession 7400645)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-09-05T21:06:56.652904\",\n\t\"name\": \"temperature-profiles-from-expendable-bathythermograph-xbt-casts-from-the-noaa-ship-fairweather-1e784\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"XBT data were collected from NOAA Ship
  FAIRWEATHER in support of the Integrated Global Ocean Services System (IGOSS) project.
  Data were collected by the US DOC; NOAA; National Ocean Service - Seattle from 12
  September 1974 to 15 September 1974. Data were processed by NODC to the NODC standard
  Universal Bathythermograph Output (UBT) format. Full format description is available
  from NODC at www.nodc.noaa.gov/General/NODC-Archive/bt.html.nnThe UBT file format
  is used for temperature-depth profile data obtained using expendable bathythermograph
  (XBT) instruments. Standard XBTs can obtain profiles at depths of about 450 or 760
  m. With special instruments, measurements can be obtained to 1830 m. Cruise information,
  position, date, and time are reported for each observation. The data record comprises
  pairs of temperature-depth values. Unlike the MBT data file, in which temperature
  values are recorded at uniform 5m intervals, the XBT Data File contains temperature
  values at non-uniform depths. These depths are at a minimum number of points (\"inflection
  points\") required to record the temperature curve to an acceptable degree of accuracy.
  On output, however, the user may request temperature values either at inflection
  points or interpolated to uniform depth increments.\",\n\t\"license_title\": null,\n\t\"extras\":
